import React from 'react';
import { Link } from 'react-router-dom';

import './Components.scss';

const Navbar = () => {
    const menusOnclick = (e) => {
        e.target.className = "active";
    };

    return (
        <div className="navbar-container">
            <div className="logo">
                <h1>EXERCISE </h1>
                <h1>LOG.</h1>
            </div>
            <ul className="navMenus-container">
                <li className="active">
                    <Link to="/">
                        Exercise Lists
                    </Link>
                </li>
                <li onClick={() => menusOnclick}>
                    <Link to="/exercises">
                        Create Exercise
                    </Link>
                </li>
                <li>
                    <Link to="/users">
                        Create User
                    </Link>
                </li>
            </ul>
        </div>
    )
};

export default Navbar;
